{{Infobox dungeon |name = Sealed Chamber |image = [[File:Sealed Chamber.png|270px]] |caption = A map of Sealed Chamber. |tokens = 36,000 |location = North of Route 134. }} '''Sealed Chamber''' is a [[Dungeons|dungeon]] in [[Hoenn]]. It initially has 49 tiles arranged in a 7x7 square, including 7 chest tiles, 17 non-boss encounter tiles, and 1 boss encounter tile.
